import api from './api';

const authService = {
  // ==================== AUTH ====================
  login: async (email, password) => {
    try {
      const response = await api.post('/auth/login', { email, password });
      return response.data;
    } catch (error) {
      console.error('Login error:', error);
      return { 
        success: false, 
        message: error.response?.data?.message || 'فشل تسجيل الدخول'
      };
